%sql
select * from uv
where
    uvi_i = ${uvi=8}
    -- and year = ${year=2017}
    -- and month = ${month=4}
    -- and day = ${day=12}
order by time

%sql
select date, time, illum, uva, uvb, uvbr, weather, year, month, day, hour from nt_uv
where
    int(illum / 1000) = 99
    -- and year = ${year=2017}
    -- and month = ${month=4}
    -- and day = ${day=12}
order by time
